module.exports = "<app-page class=\"bg-02\">\n    <div class=\"inner\">\n        <h2 class=\"text-center mb-small large-text\">利用規約</h2>\n        <p class=\"read mb-small small-text\">\n            シネマサンシャインの会員（年会費500円）になるとお得な特典が受けられます。以下の利用規約に同意した上で「次へ」ボタンを押してください。\n        </p>\n        <div class=\"box mb-small scroll-box\">\n            <h3 class=\"large-text mb-x-small\">利用規約について</h3>\n            <p>\n                本規約は、佐々木興業株式会社（以下「当社」）が独自に規定するものであり、当社の運営する「シネマサンシャイン」が提供するサービスに提供されるものとします。\n                <br> 当社が提供するシネマサンシャインをご利用になる場合には、本規約に従っていただく必要があります。ご利用の皆様はシネマサンシャインの利用をもって、本規約の内容を承諾いただけたものとみなします。\n                <br> 本規約は必要に応じて適宜見直しを行ないますので、ご利用の際には本ページに掲載されている最新の利用規約をご確認下さい。\n                <br>\n                <span class=\"text-red\">1.個人登録情報の取り扱いについて</span>\n                <br> 個人情報に関してはシネマサンシャインにて最大限の注意を払い管理いたします。個人情報の取り扱いについては、プライバシーポリシーにまとめてありますので、そちらもご覧下さい。\n                <br> またシネマサンシャインの営業譲渡が行なわれる際は、譲渡を受けた獲得者に移管いたします。なお、退会申請には速やかに応じ、個人情報を削除いたします。\n                <br>\n                <span class=\"text-red\">2.ID及びパスワードの管理について</span>\n                <br> ID及びパスワードの管理は、登録ユーザーの責任において行なっていただきます。ID及びパスワードを利用して行なわれた行為は、そのIDを保有している登録ユーザーの責任とみなします。\n                <br> 第三者への漏洩の疑いがある場合は、直ちにシネマサンシャインまでご連絡下さい。シネマサンシャインはID及びパスワードの不正使用などから生じた損害について一切責任を負いません。\n                <br>\n                <span class=\"text-red\">3.登録事項の変更について</span>\n                <br> ユーザー登録の必須項目に変更があった際には、速やかに情報の変更をお願いいたします。\n                <br>\n                <span class=\"text-red\">4.禁止事項</span>\n                <br> 他の利用者や第三者を誹謗中傷する行為や、不当に足を引っ張ろうとする行為。\n                <br> 公正な場を不当に歪めようとする行為。\n                <br> 運営者が、不適切と判断した行為。\n                <br>\n                <span class=\"text-red\">5.登録ユーザーの資格保留又は削除について</span>\n                <br> シネマサンシャインは、上記禁止事項に違反した登録ユーザーに対し、資格を保留・削除する権利を保有します。また、コンテンツを削除する権利も保有します。その判断に関しては、運営者の裁量にて行使されます。これにより損害が発生した場合でもシネマサンシャインは責任を負いません。\n                <br>\n                <span class=\"text-red\">6.サービスの中断</span>\n                <br> シネマサンシャインは、設備的事情等のやむを得ない場合に限って、利用者に事前通知なくサービスを一時的に中断することがあります。その際に利用者に生じた不利益や損失などに対して、一切の責任を負わないものとします。\n                <br> 7.営業の中止について\n                <br> シネマサンシャインは、利用者にWebサイト上またはメールによる通知の上、サービスの全部または一部を中止できるものとします。サービスの終了に伴い生じる利用者の不利益や損害などに対して、一切の責任を負わないものとします。\n                <br>\n                <span class=\"text-red\">8.免責事項</span>\n                <br> シネマサンシャインは、本サイトの利用に際して利用者が生じた不利益や損害などに対して、一切の責任を負わないものとします。\n                <br> 利用者が本サイトから得る情報などについての一切は、その受け手の責任において判断するものとし、シネマサンシャインは、いかなる保証も行なわないものにします。\n                <br> 利用者が使用する機器・ソフトウェアについて、シネマサンシャインは、その動作保証は一切行なわないものとします。\n                <br> シネマサンシャインをきっかけに契約に至った案件に関して、その後に生じたトラブルなど、シネマサンシャインでは一切の責任を負わないものとします。\n                <br>\n                <span class=\"text-red\">9.準拠法および裁判管轄について</span>\n                <br> 本規約には、日本法が適用されます。また、本規約に関連する利用者とシネマサンシャイン間の紛争については、東京地方裁判所を第一審専属管轄裁判所とします。\n            </p>\n        </div>\n        <form [formGroup]=\"termsForm\" (ngSubmit)=\"onSubmit()\">\n            <div class=\"text-center mb-small\">\n                <div class=\"mb-small\">\n                    <input type=\"checkbox\" formControlName=\"terms\" id=\"terms\">\n                    <label for=\"terms\" class=\"agree-label\">利用規約に同意する</label>\n                </div>\n                <div *ngIf=\"termsForm.controls['terms'].invalid && (termsForm.controls['terms'].dirty || termsForm.controls['terms'].touched)\"\n                    class=\"validation-text\">利用規約に同意してください</div>\n            </div>\n            <button type=\"submit\" class=\"button button-primary button-block center mb-small\">次へ</button>\n            <div class=\"text-center\">\n                <a (click)=\"prev()\" class=\"prev-link\">\n                    <app-icon iconName=\"prev-circle-white\" width=\"15\" height=\"15\"></app-icon>戻る</a>\n            </div>\n        </form>\n    </div>\n</app-page>"

